import React from "react";

function News() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Nyheter</h1>
      <ul>
        <li>Ny tävling den 15 november!</li>
        <li>Öppet hus i klubbstugan 2 december.</li>
      </ul>
    </div>
  );
}

export default News;
